"use client";
import * as React from "react";
function DatepickerContainer() {
    return (React.createElement("div", { className: "react-datepicker__container" },
        React.createElement("div", { className: "react-datepicker__input-container" },
            React.createElement("input", { type: "text" }))));
}
export default DatepickerContainer;
